import './App.css';

// Screens
import Layout from './layout/Layout';
import SignIn from './screens/SignIn/SignIn';


function App() {
  return (
    <div className="App">
      <Layout>
        <Switch>
          <Route path='/sign-in'>
            <SignIn />
            {/* <h3>log in screen</h3> */}
          </Route>
        </Switch>
      </Layout>
    </div>
  );
}

export default App;
